$(document).on('click', 'a[href^="#"]', function (event) {
    event.preventDefault();
    $('html, body').animate({
        scrollTop: ($($.attr(this, 'href')).offset().top - 46)
    }, 100);
});

if(BX.getCookie('agreement')!='1'){ setTimeout(function(){$('.footer__cookie').addClass('_show');},500);}
$('.footer__agree').on('click',function(e){
	$('.footer__cookie').hide();
	BX.setCookie('agreement', '1', {expires: 2592000,path: "/"})
});

$('.jshb').click(function(){
	if($(this).hasClass('_s')){
		$('body').addClass('_se');
		$('body').removeClass('_as');
		
		$('.sF__input').focus()
		return;
	}
	if($('body').hasClass('_se')){
		$('body').removeClass('_se')
	}else{
		$('body').toggleClass('_as')
	}
});
let vh = window.innerHeight * 0.01;
document.documentElement.style.setProperty('--vh', `${vh}px`);
window.addEventListener('resize', () => {
  let vh = window.innerHeight * 0.01;
  document.documentElement.style.setProperty('--vh', `${vh}px`);
});

$('.wiadFix__close').click(function(e) {
	$(this).parent().hide();
});

$(document).ready(function () {
	$(".fancybox").jqPhotoSwipe({
		fullscreenEl: false,
		shareEl: false,
		galleryOpen: function (gallery) {
			//gallery.toggleDesktopZoom();
		}
	});
	$(".forcedgallery > a").jqPhotoSwipe({
		forceSingleGallery: true
	});
});
/* End */
